import React, { Component } from 'react';
import { Route, Redirect } from 'react-router-dom';

// import Sidebars from 'pages/PageApp/components/Sidebars';
import Sidebar from 'components/Sidebar';
import NavigationBar from 'pages/PageApp/components/NavigationBar';

// import PageHome from 'pages/PageHome';
import PageSurvey from 'pages/PageSurvey';
import PageResults from 'pages/PageResults';
import PageSettings from 'pages/PageSettings';
import PageFeedback from 'pages/PageApp/routes/PageFeedback';
import PageProfile from 'pages/PageProfile';
import PageAdmin from 'pages/PageAdmin';
// import PageFAQ from 'pages/PageApp/routes/PageFAQ';
import PageAbout from 'pages/PageLanding/routes/PageAbout';

export default class PageDashboardLayout extends Component {
  render() {
    return (
      <div className="PageApp">
        <Sidebar leftSidebar={<NavigationBar admin={this.props.admin} />}>
          {/*<Route 
            exact 
            path="/app" 
            render={props => (
              <PageHome uid={this.props.uid} survey={this.props.survey} status={this.props.status}/>
            )} 
          />*/}
          <Route
            exact
            path="/app"
            render={() => {
              if (
                this.props.status === 'live-survey' ||
                this.props.status === 'development'
              ) {
                return <Redirect to="/app/survey" />;
              } else if (this.props.status === 'live-processing') {
                return <Redirect to="/app/results" />;
              } else if (this.props.status === 'live-matches') {
                return <Redirect to="/app/results" />;
              } else {
                return <Redirect to="/app/faq" />;
              }
            }}
          />
          <Route
            path="/app/survey"
            render={() => (
              <PageSurvey
                uid={this.props.uid}
                survey={this.props.survey}
                status={this.props.status}
              />
            )}
          />
          <Route
            path="/app/results"
            render={() => (
              <PageResults
                uid={this.props.uid}
                survey={this.props.survey}
                status={this.props.status}
              />
            )}
          />
          {this.props.admin && (
            <Route
              path="/app/admin"
              render={() => <PageAdmin settings={this.props.settings} />}
            />
          )}
          <Route
            path="/app/profile"
            render={() => <PageProfile dorms={this.props.dorms} />}
          />
          <Route path="/app/settings" component={PageSettings} />
          <Route
            path="/app/feedback"
            render={() => (
              <PageFeedback name={this.props.name} email={this.props.email} />
            )}
          />
          <Route path="/app/faq" render={() => <PageAbout left noLink />} />
        </Sidebar>
      </div>
    );
  }
}
